import React from "react";
import NavBar from "../navbar";
import Message from "../../images/Message.png";
const ForgotPassword2 = () => {
  return (
    <div className="">
      <div className="w-screen">
        <NavBar color="black" active="login" />
        <div className="flex flex-col justify-center items-center h-screen pt-10">
          <span className="text-4xl font-bold text-center text-gray-700 tracking-widest">
            Reset Password
          </span>
          <form className="flex flex-col">
            <span className="text-lg text-gray-500 my-2 w-72 text-center">
              Please input the 4-digit recovery code sent to your email address
              to proceed with your password reset.
            </span>
            <div className="bg-red-500 h-10 w-72 flex items-center px-2 my-3">
              <input type="password" className="h-8 w-8 rounded-md" />
            </div>
            <button className="text-white bg-yellow-500 text-lg tracking-wide py-2 w-4/6 rounded-md m-auto my-10">
              RESET PASSWORD
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default ForgotPassword2;
